import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
function App() {
  return (
    <>
    <div className='container'>
      <h1 className='text-center p-2'> Lista de tareas</h1>
      <div className='row'>
        <div className='col-12'>
          hola como estas
        </div>
      </div>
    </div>
    </>
  );
}

export default App;
